// ApiService.js

class ApiService {
    static async getStocks() {
      const apiKey = 'JH59KR1EHBJDXW6T'; // Replace 'your_api_key_here' with your actual API key
      const url = `https://www.alphavantage.co/query?function=TIME_SERIES_INTRADAY&apikey=${apiKey}`;

      try {
        const response = await fetch(url);
        const data = await response.json();
        // Parse the response data to extract the stock information
        const stocks = Object.entries(data['Time Series (5min)']).map(([time, info]) => ({
          time,
          price: info['4. close'] // Assuming '4. close' contains the stock price
        }));
        return stocks;
      } catch (error) {
        throw new Error('Error fetching stock data');
      }
    }
  }

  export default ApiService;
